import React from "react";
import Header from "./Header";
import axios from "axios";

export default function App() {
  async function fetchQuestions() {
    try {
      const { data } = await axios.get("http://localhost:9000/questions");
    } catch (error) {}
  }

  return (
    <div className="app">
      <Header />
    </div>
  );
}
